import{o as n,c as e,a,b as t,F as i,f as s,_ as d}from"./index.2f2355d4.js";const u=a("br",null,null,-1),r=a("br",null,null,-1),l=a("br",null,null,-1),m=a("br",null,null,-1),k=a("br",null,null,-1),o={class:"card mb-3",style:{"max-width":"1550px"}},c={class:"row g-0"},p={class:"col-md-4"},g=s('<div class="col-md-8"><div class="card-body"><h5 class="card-title">Selenoid Door Lock with fingerprint and RFID</h5><p class="card-text">Alat yang dapat membuka pintu otomatis menggunakan sidik jari dan ID dari ktp merupakan salah satu project yang pernah saya kerjakan untuk memenuhi tugas matakuliah mekatronika. Dibuatnya alat ini dengan tujuan untuk memudahkan seseorang membuka pintu secara otomatis hanya dengan memanfaatkan sidik dari dan idcard ktp, hal ini juga merupakan sebuah keuntungan dan kemanan karena dengan adanya indikasi sidik jari untuk membuka pintu maka tidak bisa sembarang orang dapat membuka pintu tanpa adanya verifikasi sidik jari terlebih dahulu. </p><p> Dengan menggunakan fingerprint sensor dapat dengan mudah merekam sekitar 100 buah sidik jari manusia dan dapat ditambah ketika ada pengguna lain ingin menggunakan produk ini, kemudian dengan adanya RFID juga memungkinkan membuka pintu menggunakan KTP sebagai kunci yang harus ditempelkan pada alat, ID yang ada pada KTP itulah yang akan diterjemahkan oleh alat menjadi sandi&quot; kunci untuk membuka pintu, ini juga tidak bisa sembarang ktp untuk membuka pintu tanpa didaftarkan terlebih dahulu. </p><p class="card-text"><small class="text-muted">Abdi Surya Perdana</small></p></div></div>',1),j={__name:"project2View",setup(h){return(_,b)=>(n(),e(i,null,[u,r,l,m,k,a("div",o,[a("div",c,[a("div",p,[t(d,{src:"meka (3).png",class:"img-fluid rounded-start"})]),g])])],64))}};export{j as default};
